import React from "react";
import img from './Images/img.png';

const Header = () => {
    return (
        <>
            <div className="header">
                <img />
                {/* <img src="" alt="logo" width='70' height='70' /> */}
                <h1>Shery</h1>
            </div>
        </>
    );
};

export default Header
